import React from "react";
import uniqid from "uniqid"




function Game(props) {
    const {change} = props;
    const characters = [
        {name: "Flintstone", src: flinstone, id: "flintstsone", key: uniqid()},
        {name: "Homer", src: homer, id: "homer", key: uniqid()},
        {name: "Patrick", src: patrick, id: "patrick", key: uniqid()},
    ]

  return (
    <div className="game">  
       {characters.map((item) => (
        <div className="card" id= {item.id} onClick={change} key = {item.key}>
            <img src = {item.src} alt="cartoon" /> 
            <h2>{item.name}</h2>
        </div>
       ))}
    </div>
  )
}

export default Game;
